import { Connect } from "react-redux"

function Favorites({myFavorytes}) {

    return (
        <div>
            {myFavorytes?.map((fav)=> (
                <Card/>
            ))}
        </div>
    )

    const mapStateToProps = (state) => {
        return {
            myFavorytes: state.myFavorytes
        }
    }

}

export default connect(null, null)(Favorites)
